import React, { Component } from 'react';

export default class Table extends Component{

	render(){
		console.log(this.props);
		return(
			<table className="table table-bordered">
			    <thead>
			      <tr>
			        <th>Title</th>
			        <th>Completed</th>
			        <th>Action</th>
			      </tr>
			    </thead>
			    <tbody>
			    
			    </tbody>
			  </table>
		)
	}
}
